function find_maximum_ribbon_length(ribbons, k) {
    var lower_bound = 0;
    var upper_bound = 100000;
    while (lower_bound < upper_bound) {
        var middle = (lower_bound + upper_bound + 1) >> 1;
        var count = 0;
        for (var ribbon of ribbons) {
            count += Math.floor(ribbon / middle);
        }
        if (count < k) {
            upper_bound = middle - 1;
        }
